import React from 'react';
import styled from 'styled-components';

import Lyft from '../../../img/lyft.svg';
import Slack from '../../../img/slack.svg';
import Gloss from '../../../img/glossier.svg';
import Chari from '../../../img/charity_water.svg';
import MissG  from '../../../img/missguided.svg';

import './LogoBlock.css';

const HeaderContainer = styled.div`
    width: 1903px;
    position: absolute;
    top: 900px;

`
const InContainer = styled.div`
    width: 1040px;
    margin: 0 432px 120px 432px;
    padding: 0 20px;

`
const Image = styled.div`
        z-index: 5;
        display: flex;
        justify-content: space-between;
    img{
        width: auto;
        height: 48px;
        z-index: 5;
        }

`
const TextOnHover = styled.span`
    width: 1040px;
    text-align: center;
    position: absolute;




`

class PartnersLogoBlock extends React.Component {
  render(){
    return (
        <HeaderContainer>
            <InContainer className="hover">
                <Image className="blurHover">
                    <img src={Lyft} alt="phone"/>
                    <img src={Slack} alt="tablet"/> 
                    <img src={Chari} alt="tablet"/>
                    <img src={MissG} alt="tablet"/>
                    <img src={Gloss} alt="tablet"/>


                </Image>
                <TextOnHover className="textHover">
                    Millions of tech-forward businesses use Stripe to power their&nbsp;payments
                </TextOnHover>
            </InContainer>
        </HeaderContainer>
    );
  }
}
export default PartnersLogoBlock;
